import zhCN from 'antd/lib/locale/zh_CN';
import moment from 'moment';
import 'moment/locale/zh-cn';
import 'antd/dist/antd.css';
moment.locale('zh-cn');

ReactDOM.render(
  //<React.StrictMode>
  <ConfigProvider locale={zhCN}>
        <App />,
  </ConfigProvider>,

 // </React.StrictMode>,
  document.getElementById('root')
);

